country_data_m = 'country_data_m.csv'
m_year = pd.read_csv(country_data_m, nrows=161, index_col=0, header=0, sep=';', na_values=[""])

country_data_e = 'country_data_e.csv'
e_year = pd.read_csv(country_data_e, nrows=161, index_col=0, header=0, sep=';', na_values=[""])

country_data_i = 'country_data_i.csv'
i_year = pd.read_csv(country_data_i, nrows=161, index_col=0, header=0, sep=';', na_values=[""])

m_tr = m_year.transpose()
e_tr = e_year.transpose()
i_tr = i_year.transpose()

m_tr=m_tr.reset_index().melt(id_vars='index')
e_tr=e_tr.reset_index().melt(id_vars='index')
i_tr=i_tr.reset_index().melt(id_vars='index')

m_tr=pd.DataFrame(m_tr.groupby(['variable','index'])['value'].apply(lambda x: [i for i in x])).reset_index()
e_tr=pd.DataFrame(e_tr.groupby(['variable','index'])['value'].apply(lambda x: [i for i in x])).reset_index()
i_tr=pd.DataFrame(i_tr.groupby(['variable','index'])['value'].apply(lambda x: [i for i in x])).reset_index()

m_tr = m_tr.rename(columns = {"variable": "country", "index":"year", "value": "m"}) 
m_tr['year'] = pd.to_numeric(m_tr['year'],errors='coerce')
e_tr = e_tr.rename(columns = {"variable": "country", "index":"year", "value": "e"}) 
e_tr['year'] = pd.to_numeric(e_tr['year'],errors='coerce')
i_tr = i_tr.rename(columns = {"variable": "country", "index":"year", "value": "i"}) 
i_tr['year'] = pd.to_numeric(i_tr['year'],errors='coerce')

final_dict_m={}
for i in m_tr.country.unique():
    final_dict_m[i]=m_tr[m_tr['country']==i].drop('country',axis=1).set_index('year').T.to_dict()
final_dict_e={}
for i in e_tr.country.unique():
    final_dict_e[i]=e_tr[e_tr['country']==i].drop('country',axis=1).set_index('year').T.to_dict()
final_dict_i={}
for i in i_tr.country.unique():
    final_dict_i[i]=i_tr[i_tr['country']==i].drop('country',axis=1).set_index('year').T.to_dict()

country_dict_m={i:{i:j['m'] for i,j in final_dict_m[i].items()} for i in final_dict_m.keys()}
country_dict_e={i:{i:j['e'] for i,j in final_dict_e[i].items()} for i in final_dict_e.keys()}
country_dict_i={i:{i:j['i'] for i,j in final_dict_i[i].items()} for i in final_dict_i.keys()}


